      <div>
        {/* Componente Menu */}
        <Menu />
  
        {/* Conteúdo do layout */}
        <div>
          <h1>Conteúdo do Layout</h1>
          {/* Coloque outros componentes aqui */}
        </div>
      </div>
    );
  };
  
  export default Layouts;
